import React from 'react';
import PropTypes from 'prop-types';
import {
  Typographys,
  styles,
  Card,
  Image,
  ImageContent,
  CardBody,
  CardFooter,
  PokemonType,
} from '../MaterialCard/MaterialCardStyle';
import Grid from '@material-ui/core/Grid';
import { colors } from '../../styles/styles';

const GenerationCard = ({
    generations,
}) => (
  <Grid align="center" container style={styles.root}>
    {
      generations.map((item) => (
        item.map((generation) => (
          <Grid item xs={12} key={generation}>
            <Card style={styles.cardPokemon} elevation={2}>
              {/* <ImageContent>
                <Image src={`${item.image}${pokemon.name}.gif`} />
              </ImageContent> */}
                <Typographys variant="title">{generation}</Typographys>
              <CardBody>

              </CardBody>
              <CardFooter>
                {/* <Typographys className="pokemon-number" align="right" variant="body1">#{pokemon.id}</Typographys> */}
              </CardFooter>
            </Card>
          </Grid>
        ))
      ))
    }
  </Grid>
);

GenerationCard.propTypes = {
  generations: PropTypes.array,
}

export default GenerationCard;
